import React from 'react';
import TaskList from './TaskList';
import { connect } from 'react-redux';

const Dashboard = () => {
  return(
    <div>
      <h1>Dashboard</h1>
        <TaskList/>
    </div>
  )
}



const mapStateToProps = ({ allTasks: {taskList} })=> ({taskList});

export default connect(mapStateToProps, null)(Dashboard);
